FICA  A PESSOA JURÍDICA ACIMA NOTIFICADA DA ENTREGA DOS SEGUINTES LAUDOS DE ANÁLISE DE PRODUTOS COLETADOS NESTE ESTABELECIMENTO E EMITIDOS PELO LABORATÓRIO DE SAÚDE PÚBLICA DR. GIOVANNI CYSNEIROS:
1) LAUDO DE ANÁLISE Nº 968.1P.0/2024 DO PRODUTO ACHOCOLATADO EM PÓ MARCA TODDY, COM RESULTADO SATISFATÓRIO PARA TODAS AS ANÁLISES REALIZADAS;
2) LAUDO DE ANÁLISE Nº 970.1P.0/2024 DO PRODUTO QUEIJO PARMESÃO RALADO, MARCA RELÍQUIA DO SÍTIO, COM RESULTADO INSATISFATÓRIO PARA ANÁLISE DE ROTULAGEM E SATISFATÓRIO PARA AS DEMAIS ANÁLISES REALIZADAS.
